    data: |
      SELECT - 12 * - + COUNT ( * ) / COALESCE ( COUNT ( * ), CAST ( + 72 AS INTEGER ) ) - - 79 + + - 28 + - CASE 48 WHEN - + 9 THEN - ( - 79 ) WHEN - 93 THEN - - COUNT ( * ) ELSE - 29 + - - COALESCE ( - 87, 59 ) * + 79 END / 93 AS col0;

outputs:
  - name: q690.out
    data: |
      137
